  var a = "bye";
  if(true){
    var a = "hello";
    console.log(a);
  }
  console.log(a);
}
constFunction();


function App() {

  const name = ['남윤재','남윤재2'];

  return (
    <>
    <h1>{name[0]}, {name[1]}</h1>  
    <h1>리액트 테스트</h1>  
    </>
  );
}

export default App;
